import React from 'react';

function RegisterForm({ visible, setVisible, onShowLogin }) {
  const closeForm = () => {
    setVisible(false);
  };

  return (
    <div className={`register-form-container${visible ? ' active' : ''}`}>
      <div id="close-register-btn" className="fas fa-times" onClick={closeForm}></div>

      <form action="/register">
        <h3>Register</h3>

        <span>Username</span>
        <input type="text" name="username" className="box" placeholder="Enter your username" id="username" />

        <span>Email</span>
        <input type="email" name="email" className="box" placeholder="Enter your email" id="email" />

        <span>Password</span>
        <input type="password" name="password" className="box" placeholder="Enter your password" id="password" />

        <span>Confirm Password</span>
        <input type="password" name="confirmPassword" className="box" placeholder="Confirm your password" id="confirmPassword" />

        <input type="submit" value="Register" className="btn" />

        <p>Already have an account? <a href="#" onClick={(e) => { e.preventDefault(); onShowLogin(); }}>Sign in</a></p>
      </form>
    </div>
  );
}

export default RegisterForm;
